package ir.gonabad.taskmanagment.framework.network.mapperimport ir.gonabad.core.domain.listCategory.CategoryListimport ir.gonabad.core.domain.login.Loginimport ir.gonabad.core.domain.login.Resultimport ir.gonabad.taskmanagment.framework.network.entities.category.CategoryListEntityimport ir.gonabad.taskmanagment.framework.network.entities.login.LoginEntityimport ir.gonabad.taskmanagment.framework.network.entities.login.ResultEntityimport ir.gonabad.taskmanagment.framework.utils.EntityMapperimport javax.inject.Injectclass CategoryListMapper @Inject constructor() : EntityMapper<CategoryListEntity , CategoryList> {    override fun mapFromEntity(entity: CategoryListEntity): CategoryList {        return CategoryList(            status = entity.status ,            result = entity.result        )    }    override fun mapToEntity(domainModel: CategoryList): CategoryListEntity {        return CategoryListEntity(            status = domainModel.status ,            result = domainModel.result        )    }}